
DROP TABLE IF EXISTS "wiki";
SELECT DropGeometryColumn('public','wiki', 'way');
CREATE TABLE "wiki" (
  "id" BIGINT PRIMARY KEY,
  "title" VARCHAR(511),
  "name" VARCHAR(511),
  "place" VARCHAR(127),
  "status" VARCHAR(127),
  "ele" INT,
  "population" INT, 
  "text_length" INT,
  "historic" VARCHAR(127),
  "castle_type" VARCHAR(127),
  "ruins" INT,
  "amenity" VARCHAR(127),
  "religion" VARCHAR(63),
  "place_of_worship" VARCHAR(63),
  "tourism" VARCHAR(63),
  "natural" VARCHAR(127),    
  "osm_id" BIGINT
);
SELECT AddGeometryColumn('wiki', 'way', 900913, 'POINT', 2);


